window.bookSummaryJSON = "<p>The seventh book of this dark urban fantasy series follows necromancer Eric Carter through a world of vengeful gods and goddesses, mysterious murders, and restless ghosts.</p> <p>Family is murder.</p> <p>When Eric Carter helps a friend with a deadly ritual that could determine the fate of the most powerful mage family in Los Angeles he steps into the middle of centuries-long feuds with people who make the Borgias look like the Brady Bunch.</p> <p>Eric's just fine with the murder, soul eaters, and death magic. He's just having trouble adjusting to being brought back from the grave.</p> <p>If he's not careful, somebody's going to put him right back.</p> <p>Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!</p> <p>Performed by Michael John Casey, Rana Kay, Nora Achrati, Aure Nash, Nick DePinto, Kimberley Gilbert, Yasmin Tuazon, Nazia Chaudhry, Terence Aselford, Dawn Ursula, Chris Stinson, Elizabeth Jernigan, Troy Allan, Stephen Carpenter, Amanda Forstrom, Jeri Marshall, Carolyn Kashner, David Cui Cui, Chris Davenport, K'Lai Rivera, Rayner Gabriel, and Robb Moreira.</p>"; 
